import React, { Component } from 'react';
import NoteCard from './NoteCard/NoteCard';

class NoteList extends Component{
    render(){
        return(
            <ul>
                {
                    Array.of('Trabalho', 'Trabalho', 'Estudos').map((item, index) => {
                        return(
                            <li key={index}>
                                <span>{item}</span>
                                <NoteCard></NoteCard>
                            </li>
                        ); 
                    })
                }
            </ul>
        )
    }
}

export default NoteList;
